import React from 'react';

const Dashboard = React.lazy(() => import('../views/Dashboard'))
const AkunBank = React.lazy(() => import('../views/AkunBank'))
const Buyer = React.lazy(() => import('../views/Buyer'))
const Supplier = React.lazy(() => import('../views/Supplier'))
const Satuan = React.lazy(() => import('../views/Satuan'))
const BarangGarment = React.lazy(() => import('../views/BarangGarment'))
const BuyerGarment = React.lazy(() => import('../views/BuyerGarment'))
const BrandBuyerGarment = React.lazy(() => import('../views/BrandBuyerGarment'))
const TargetOmzetDivisiGarment = React.lazy(() => import('../views/TargetOmzetDivisiGarment'))
const SupplierGarment = React.lazy(() => import('../views/SupplierGarment'))
const Barang = React.lazy(() => import('../views/Barang'))
const PajakPPH = React.lazy(() => import('../views/PajakPPH'))

const routes = [
    { path: '/Dashboard', name: 'Dashboard', component: Dashboard },
    { path: '/AkunBank', name: 'AkunBank', component: AkunBank },
    { path: '/Buyer', name: 'Buyer', component: Buyer },
    { path: '/Supplier', name: 'Supplier', component: Supplier },
    { path: '/Satuan', name: 'Satuan', component: Satuan },
    { path: '/BarangGarment', name: 'BarangGarment', component: BarangGarment },
    { path: '/BuyerGarment', name: 'BuyerGarment', component: BuyerGarment },
    { path: '/BrandBuyerGarment', name: 'BrandBuyerGarment', component: BrandBuyerGarment },
    { path: '/TargetOmzetDivisiGarment', name: 'TargetOmzetDivisiGarment', component: TargetOmzetDivisiGarment },
    { path: '/SupplierGarment', name: 'SupplierGarment', component: SupplierGarment },
    { path: '/Barang', name: 'Barang', component: Barang },
    { path: '/PajakPPH', name: 'PajakPPH', component: PajakPPH },
]

export default routes;
